import axios from 'axios';

export function getParkings(location) {
    const params = {
        limit: 6,
        term: 'parking',
        location: location,
        offset: 0,
    }
    return (dispatch) => {
        return axios.get("https://api.yelp.com/v3/businesses/search", {
                params: params
            }, {
                headers: {
                    'Authorization': '7dq_mpXibH16XJ_nNT2Ynezgvd7B56kuJFPGF-37LD8f09jkZdx4-fU6s5PZARhEEUB-MTbIiKT1ZquJ5nFq1QG7T3WblddHPj26WJDry-mELsVFj2fnOTImxgH4YHYx'
                }
            })
            .then(res => JSON.parse(res))
            .then(res => console.log(res))
            /*.then(res => {
                dispatch({
                    type: 'GET_BUSINESS',
                    payload: res.data
                })
            })*/
            .catch(e => console.error(e))
    }
}
